                MoxaClassBased_PerStreamPriorityDataType *pValue = MOXACLASSBASED_EXTENSIONOBJECT_GET_ENCODEABLE(PerStreamPriorityDataType, &variant.Value.Array.Value.ExtensionObjectArray[i]);
